Accounts_CustomFields_Description:
უნდა იყოს მოქმედი JSON, სადაც გასაღებები არის ველების სახელები, რომლებიც შეიცავს ველების პარამეტრების ლექსიკონს. მაგალითი: <br/> <code> {
 "role": {
  "type": "select",
  "defaultValue": "student",
  "options": ["teacher", "student"],
  "required": true,
  "modifyRecordField": {
   "array": true,
   "field": "roles"
  }}, "twitter": {
  "type": "text",
  "required": true,
  "minLength": 2,
  "maxLength": 10
 }} </code>
